  `type` varchar(50) NOT NULL COMMENT 'bus_status, route_issues, stop_info, general_suggestion',
  `category` varchar(50) DEFAULT NULL COMMENT 'delayed, crowded, broken, detour, suspension, new_stop, accessibility, etc.',
